import './login.css';
import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';

// Validation Schema with Yup
const LoginSchema = Yup.object().shape({
  email: Yup.string()
    .email('Invalid email format')
    .required('Email is required'),
  password: Yup.string()
    .min(6, 'Password must be at least 6 characters')
    .required('Password is required'),
});

const LoginForm = () => {
  const handleSubmit = async (values, { setSubmitting, resetForm, setStatus }) => {
    try {
      const response = await axios.post('http://localhost:5000/api/auth/login', values);
      setStatus({ success: 'Login successful!' });
      resetForm();
      console.log(response.data);
    } catch (error) {
      setStatus({ error: 'Login failed!' });
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-md-6">
          <img
            src="http://knowledgemission.kerala.gov.in/img/official-login.jpg"
            className="img-fluid"
            alt="Login"
          />
        </div>
        <div className="col-md-6">
          <div className="form-container">
            <Formik
              initialValues={{ email: '', password: '' }}
              validationSchema={LoginSchema}
              onSubmit={handleSubmit}
            >
              {({ isSubmitting, status }) => (
                <Form className="form-card">
                  <h2 className="form-heading">Login</h2>

                  <div className="form-group">
                    <label htmlFor="email" className="form-label">Email:</label>
                    <Field
                      type="email"
                      name="email"
                      className="form-control"
                      placeholder="Enter your email"
                    />
                    <ErrorMessage name="email" component="div" className="ErrorMessage" />
                  </div>

                  <div className="form-group">
                    <label htmlFor="password" className="form-label">Password:</label>
                    <Field
                      type="password"
                      name="password"
                      className="form-control"
                      placeholder="Enter your password"
                    />
                    <ErrorMessage name="password" component="div" className="ErrorMessage" />
                  </div>

                  <div className="row">
                    <div className="col-12">
                      <a href="#">Forgot Password?</a>
                    </div>
                    <div className="col-12">
                      <button
                        type="submit"
                        className="btn btn-primary submit-btn mt-3"
                        disabled={isSubmitting}
                      >
                        {isSubmitting ? 'Submitting...' : 'Submit'}
                      </button>
                    </div>
                    <hr />
                    <div className="col-12">
                      <button type="button" className="btn btn-primary submit-btn mt-3">
                        Sign In With Google
                      </button>
                    </div>
                  </div>

                  {status && status.success && (
                    <div className="alert alert-success mt-3">{status.success}</div>
                  )}
                  {status && status.error && (
                    <div className="alert alert-danger mt-3">{status.error}</div>
                  )}
                </Form>
              )}
            </Formik>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
